import { Modal, Button } from "react-bootstrap";
function Input(props) {
  // const [show, setShow] = useState(false);

  //  const handleClose = () => setShow(false);
  // const handleShow = () => setShow(true);

  return (
    <>
      <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
        show={props.show}
        onHide={props.onHide}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton style={{ textAlign: "center" }}>
          <Modal.Title id="contained-modal-title-vcenter">
            <h4>Cr√©er un compte pour un nouveau coach</h4>
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div className="row mb-2">
            <div className="col-md-5">
              <input type="text" id="nom" placeholder="Nom" />
            </div>
            <div className="col-md-5">
              <input type="text" id="prenom" placeholder="prenom" />
            </div>
          </div>

          <div className="mb-2">
            <input type="radio" value="Coach" name="gender" className="mr-5" /> Coach

            <input type="radio" value="Superviseur" name="gender" /> Superviseur
          </div>

          <div className="row mb-2">
            <div className="col-md-5">
              <input type="email" id="nom" placeholder="Adresse Email" />
            </div>
            <div className="col-md-5">
              <input type="password" id="Password" placeholder="Password" />
            </div>
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={props.onHide}>
            Close
          </Button>
          <Button variant="primary">Understood</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default Input;
